window.bookSummaryJSON = "<p><b>My one piece of advice: Never kiss a stranger.</b><br> <br> See, I kind of kissed this sexy man at the bar on a dare once, and it turns out he’s a Royal Fae destined to be my mate. Now I’ve been dragged to the Elemental Fae Academy to control the powers I unlocked that night.<br> <br> So kissing? Yeah, that won’t happen again. Nope.<br> <br> Lesson learned.<br> <br> Except, I kind of kissed Titus, too. And, well, now, I’m in a world of trouble. I keep burning things down, flooding dorms, and I’ve attracted the campus mean girl brigade.<br> <br> This Fae Realm is a nightmare come to life. Truly.<br> But there are dreams here, too.<br> <br> Sexy ones.<br> <br> And they’re in the form of five Elemental Fae mentors. They’re supposed to help me control my powers, but who’s going to keep the elements from controlling me?<br> <br> <b><i>Never Kiss a Fae</i></b><b> is the complete series collection of Elemental Fae Academy and Elemental Fae Queen.</b></p>"; 
